import React  from "react";

const Card = () => {
    return(
        <>

        <div className="container">
            <div className="row">
                <div className="col-md-4">
                    <div className="card">
                        <div className="img_box">
                            <img src="" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
  
        </>
    )
}
export default Card;
